    {
        path: '/', //para la home page
        name: 'home',
        component:HomePage
    },
    {
        path: '/create', //para la home page
        name: 'create',
        component:CreatePage
    }

]

const router = createRouter({
    history:createWebHistory(), //Navegaci칩n por defecto
    routes,
}) 

